Uma árvore de decisão irá caír sempre em overfitting se a deixarmos crescer até à sua máxima profundidade; Para evitar isto, podemos efetuar pre-prunning (parar o crescimento cedo) ou post-prunning (após o treino completo da árvore). Pre-Prunning min_sample_split \( \rightarrow \) é o número mínimo de samples para cada split . min_samples_split_grid_search = GridSearchCV( estimator=DecisionTreeClassifier(random_state=2020), scoring=make_scorer(accuracy_scorer), param_grid=ParameterGrid( {"min_samples_split":[[min_samples_split] for min_samples_split in np.arange(EPS, 1, 0.025)]} ),
) min_sample_leaf \( \rightarrow \) número mínimo de samples para ser uma folha. min_samples_split_grid_search = GridSearchCV( estimator=DecisionTreeClassifier(random_state=2020), scoring=make_scorer(accuracy_scorer), param_grid=ParameterGrid( {"min_samples_leaf":[[min_samples_leaf] for min_samples_leaf in np.arange(0.000001, 1, 0.025)]} ),
) Post-Prunning Define uma profundidade máxima para a árvore. full_tree = DecisionTreeClassifier(random_state=2020)
full_tree.fit(x_train, y_train) print(full_tree.get_depth())
print(full_tree.get_n_leaves()) max_depth_grid_search = GridSearchCV( estimator=DecisionTreeClassifier(random_state=2020), scoring=make_scorer(accuracy_scorer), param_grid=ParameterGrid( {"max_depth":[[max_depth] for max_depth in range(1, max_depth + 1)]} ),
) O prunning inicia-se com uma árvore que não tenha sido prunned , utilizando uma sequência de sub-árvores ( prunned ), das quais escolhe a melhor através de um processo de cross-validation ; O custo da complexidade deste processo é dado por: \[ R_{\alpha}(T_{t}) = R(T_{t}) + \alpha |T_t| \] ou \[ TreeScore_t = SSR + \alpha |T_t| \] onde \( R(T) \) representa o total do erro dos nós folhas, \( |T| \) representa o número de nós folhas e \( \alpha \) o parâmetro da complexidade. ccp_alphas = full_tree.cost_complexity_pruning_path(x_train, y_train)["ccp_alphas"]
ccp_alpha_grid_search = GridSearchCV( estimator=DecisionTreeClassifier(random_state=42), scoring=make_scorer(accuracy_scorer), param_grid=ParameterGrid( {"ccp_alpha":[[alpha] for alpha in ccp_alphas]} ),
)
